import { React, useState, useEffect } from "react";
import { useHistory, Link } from "react-router-dom";
import { loginUser } from "../../../Services/Login";
import FootersLayout from "../../layouts/Footers";
import HeadersLayout from "../../layouts/Headers";
import PropTypes from "prop-types";

export default function Login(props) {
  Login.propTypes = {
    isFirstRender: PropTypes.object.isRequired,
    url: PropTypes.string,
  };

  const { url, isFirstRender } = props;
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [ErrorMsg, setErrorMsg] = useState("");
  const [IsError, setIsError] = useState("");
  const hi = useHistory();
  useEffect(() => {
    localStorage.removeItem("token");
    localStorage.removeItem("role");
    localStorage.removeItem("email");
    localStorage.removeItem("ghostUser");
    localStorage.removeItem("ghostUserName");
    localStorage.removeItem("ghostUserAgency");
  }, []);

  const _RegisterAgency = async () => {
    hi.push("/get-registered");
  };
  const _loginUser = async (e) => {
    e.preventDefault();
    let loginCredentials = {
      username: username,
      password: password,
    };
    loginUser(loginCredentials).then((data) => {
      if (data.status === 401) {
        setIsError(true);
        setErrorMsg("Invalid Credentials");
      } else {
        localStorage.setItem("token", JSON.stringify(data.token));
        localStorage.setItem("role", JSON.stringify(data.user.role));
        localStorage.setItem("email", JSON.stringify(data.user.username));
        localStorage.setItem("function", JSON.stringify(data.user.function));
        localStorage.setItem("db", JSON.stringify(data.user.db));
        localStorage.setItem(
          "underwriter",
          JSON.stringify(data.user.AgencyUnderwriter),
        );
        isFirstRender.current = false;
        if (data.user.role === "partner") {
          hi.push("/api-docs");
        } else {
          if (url === "/AgentApproval/") {
            hi.goBack();
          } else {
            hi.push("/marketplace");
          }
        }
      }
    });
  };

  return (
    <>
      <HeadersLayout />
      <div className="container-fluid p-0 bg">
        <div className="row box align-items-center justify-content-center">
          <div className="">
            <div className="img-outer">
              <div className="img-wrap-right text-center">
                <img
                  src="https://marketplace.fluxins.com/assets/Images/Flux_Cannabis_Icon.png"
                  className="imgs"
                  alt="Capture"
                />
                <h2 className="login-header-h2">Login</h2>
              </div>
            </div>

            <div className="login">
              <div className="form card">
                <form
                  id="account"
                  action="/login"
                  method="post"
                  className="login-form text-center"
                >
                  <div className="single-input">
                    <span className="login-input-icon">
                      <i className="fas fa-user"></i>
                    </span>
                    <input
                      type="email"
                      data-val="true"
                      data-val-email="The Email field is not a valid e-mail address."
                      data-val-required="The Email field is required."
                      id="Input_Email"
                      name="username"
                      value={username}
                      onChange={(e) => setUsername(e.target.value)}
                    />
                    <span
                      className="text-danger field-validation-valid"
                      data-valmsg-for="Input.Email"
                      data-valmsg-replace="true"
                    ></span>
                  </div>
                  <div className="single-input">
                    <span className="login-input-icon">
                      <i className="fas fa-unlock"></i>
                    </span>

                    <input
                      type="password"
                      data-val="true"
                      data-val-required="The Password field is required."
                      id="Input_Password"
                      name="password"
                      onChange={(e) => setPassword(e.target.value)}
                      value={password}
                    />
                    <span
                      className="text-danger field-validation-valid"
                      data-valmsg-for="Input.Password"
                      data-valmsg-replace="true"
                    ></span>
                  </div>
                  {IsError === true && (
                    <>
                      <div
                        className="alert alert-danger fade show"
                        role="alert"
                      >
                        <p className=" mb-0 text-start">{ErrorMsg}</p>
                      </div>
                    </>
                  )}
                  <div className="text-center d-block forgot-btm-border pb-3">
                    <button
                      type="submit"
                      className="btn btn-lg sign-in mb-2"
                      onClick={_loginUser}
                    >
                      Log in
                    </button>

                    <Link className="forgot-password" to={`/forgotpassword`}>
                      <span className="forget forgotBtn">
                        Forgot your password?
                      </span>
                    </Link>
                    <br />
                  </div>
                  <div className="d-flex flex-column pt-2">
                    <p className="forget getappointedBtn m-0 pb-1">
                      New to Flux?
                    </p>
                    <button
                      className="btn btn-lg sign-in mb-2"
                      onClick={_RegisterAgency}
                    >
                      Get Registered
                    </button>
                  </div>
                </form>
              </div>
            </div>
            <div className="footer-head text-center login-footer-datawrap">
              <span className="login-dummy-text">
                {" "}
                PROTECT • STREAMLINE • GROW{" "}
              </span>
            </div>
          </div>
        </div>
      </div>
      <FootersLayout />
    </>
  );
}
